function [ys_, params, info] = DynamicSpatialModel_steadystate2(ys_, exo_, params)
% Steady state generated by Dynare preprocessor
    info = 0;
    GA_=1.005;
    GN_=1.0025;
    tau_=2;
    phi_=1;
    beta_=0.99;
    Distance_1_1_=0;
    Distance_1_2_=0.5;
    Distance_2_1_=0.5;
    Distance_2_2_=0;
    AT_1_=1;
    AT_2_=1;
    MaxDistance_=0.5;
    GYTrend_=(GA_*GN_)^((1-params(1))*(1-params(3))*(1+params(7))/((1-params(1))*(1-params(3))*(1+params(7))-params(7)));
    GZTrend_=GYTrend_^(1/(1+params(7)));
    GFTrend_=GYTrend_^((1-params(2))/(1+params(7)));
    GPTrend_=GYTrend_^((-(params(7)+params(2)))/(1+params(7)));
    GUTrend_=GYTrend_^(params(11)+(1-params(2))*params(12)/(1+params(7)))/GN_^(params(11)+params(12)+params(13));
    GmuNTrend_=GYTrend_^((params(11)+(1-params(2))*params(12)/(1+params(7)))*(1-params(5)))/GN_^((params(11)+params(12)+params(13))*(1-params(5)));
