    GQTrend_=GYTrend_^((-(params(7)+params(2)))/(1+params(7)));
    GSRKTrend_=GYTrend_^((-(params(7)+params(2)))/(1+params(7)));
    GJTrend_=GYTrend_^(1/(1+params(7)));
    Xi_LEAD_=GN_*beta_/GFTrend_*GUTrend_^(1-params(5));
    L_1_=params(2)*params(12)/(params(13)+params(2)*params(12));
    R_=1/Xi_LEAD_;
    N_1_=1;
    N_=N_1_;
    N_1_LAG_=1/GN_;
    N_LAG_=N_1_LAG_;
