    SN_1__2_=params(17)/(params(15)/(N_1_LAG_-SN_1_)+params(16)*(Distance_1_2_*SN_1_-SD_1_)/(SN_1_*MaxDistance_*SN_1_-SN_1_*SD_1_));
    A_1_=1;
    A_1_LEAD_=GA_;
    AverageTransportCost_=((exp(Distance_1_1_*(-tau_)/params(7))+exp(Distance_1_2_*(-tau_)/params(7)))/2)^(-params(7));
    P_1_Over_Q_1_=1-params(10)/2*(GYTrend_-1)^2-GYTrend_*params(10)*(GYTrend_-1)+(GYTrend_-1)*params(10)*GQTrend_*Xi_LEAD_*GYTrend_^2;
    F_1_=GetF_1_(A_1_,N_1_,N_1_LAG_,params(4),params(2),params(18),L_1_,params(7),phi_,params(8),GJTrend_,AverageTransportCost_,params(11),params(12),params(14),params(3),params(1),GYTrend_,GSRKTrend_,P_1_Over_Q_1_,Xi_LEAD_,GQTrend_,params(9),params(10),GSPTrend_);
