    YBar_1_=GetYBar_1_(1);
    SP_1_=(1-params(2))*F_1_/(F_1_/L_1_^params(2))^(1/(1-params(2)));
    P_1_=AverageTransportCost_*SP_1_*(1+params(7))*((Z_1_-(F_1_/L_1_^params(2))^(1/(1-params(2))))/(phi_*(1-(1-params(8))/GJTrend_)+YBar_1_*((1+params(7))*SP_1_)^((-(1+params(7)))/params(7))))^(-params(7));
    H_1_=(Z_1_*SP_1_*(1-params(1))*(1-params(3))*params(12)*N_1_/F_1_/(1+params(4))*params(18)^(1+params(4))/(params(14)/N_1_LAG_^params(4)+Z_1_*SP_1_*(1-params(1))*(1-params(3))*params(12)*N_1_/F_1_/(1+params(4))/N_1_LAG_^(1+params(4))))^(1/(1+params(4)));
    J_1_=(Z_1_-(F_1_/L_1_^params(2))^(1/(1-params(2))))/(phi_*(1-(1-params(8))/GJTrend_)+YBar_1_*((1+params(7))*SP_1_)^((-(1+params(7)))/params(7)));
    K_1_=P_1_Over_Q_1_*GSRKTrend_*GYTrend_*Z_1_*SP_1_*params(1)*(1-params(3))/P_1_/(1/Xi_LEAD_-GQTrend_*(1-params(9)));
    W_1_=Z_1_*(1-params(1))*(1-params(3))*SP_1_/H_1_;
    SRL_1_=params(2)*F_1_/L_1_;
    ZF_1_=(F_1_/L_1_^params(2))^(1/(1-params(2)));
    Q_1_=P_1_/P_1_Over_Q_1_;
    C_1_=params(11)*F_1_/(params(12)*P_1_);
    I_1_=K_1_*(1-(1-params(9))/GYTrend_)/(1-params(10)/2*(GYTrend_-1)^2);
    Pi_1_=YBar_1_*params(7)/(1+params(7))*(1+params(7))^((-1)/params(7))*SP_1_^((-1)/params(7));
    M_1_=Z_1_*params(3)*SP_1_/P_1_;
    Y_1_=M_1_+C_1_+I_1_;
    SRK_1_=Z_1_*SP_1_*params(1)*(1-params(3))/(K_1_/GYTrend_);
    E_1_=F_1_;
    U_1_=(C_1_/N_1_LAG_)^params(11)*(F_1_/N_1_LAG_)^params(12)*((1-L_1_)/N_1_LAG_)^params(13)*(params(18)^(1+params(4))*1/(1+params(4))-1/(1+params(4))*(H_1_/N_1_LAG_)^(1+params(4)))^params(14)*(1-SN_1_/N_1_LAG_)^params(15)*(MaxDistance_-SD_1_/SN_1_)^params(16)*exp(params(17)*(log(SN_1__1_/N_1_LAG_)+log(SN_1__2_/N_1_LAG_))/2);
    U_1_LEAD_=GUTrend_*U_1_;
    H_1_LEAD_=GN_*H_1_;
    muN_1_=beta_*(U_1_LEAD_^(1-params(5))+(1-params(5))*U_1_LEAD_^(1-params(5))*(params(14)*(H_1_LEAD_/N_1_)^(1+params(4))/(params(18)^(1+params(4))*1/(1+params(4))-1/(1+params(4))*(H_1_LEAD_/N_1_)^(1+params(4)))+GN_*params(15)*SN_1_/(N_1_-GN_*SN_1_)-(params(11)+params(12)+params(13)+params(17))))/(1-GN_*beta_*GmuNTrend_);
    C_2_=C_1_;
    K_2_=K_1_;
    I_2_=I_1_;
    E_2_=E_1_;
    F_2_=F_1_;
    Q_2_=Q_1_;
    J_2_=J_1_;
    L_2_=L_1_;
    H_2_=H_1_;
    N_2_=N_1_;
    SN_2_=SN_1_;
    SD_2_=SD_1_;
    muN_2_=muN_1_;
